import React, { Component } from 'react';
import { slide as sideMenu } from 'react-burger-menu';

export class NotificationDrawer extends Component {

    render(){
        return (
            <sideMenu
                right
                width={25}
                noOverlay
                isOpen={true}

            >
                Notification Window Thing
            </sideMenu>
        );
    }
}
